  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from the U.S. Census Bureau's Master Address File / Topologically Integrated Geographic
  Encoding and Referencing (MAF/TIGER) Database (MTDB).  The MTDB represents a seamless
  national file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
  is designed to stand alone as an independent data set, or they can be combined to
  cover the entire nation.nMetropolitan Divisions subdivide a Metropolitan Statistical
  Area containing a single core urban area that has a population of at least 2.5 million
  to form smaller groupings of counties or equivalent entities.  Not all Metropolitan
  Statistical Areas with urban areas of this size will contain Metropolitan Divisions.
  \ Metropolitan Division are defined by the Office of Management and Budget (OMB)
  and consist of one or more main counties or equivalent entities that represent an
  employment center or centers, plus adjacent counties associated with the main county
  or counties through commuting ties.  Because Metropolitan Divisions represent subdivisions
  of larger Metropolitan Statistical Areas, it is not appropriate to rank or compare
  Metropolitan Divisions with Metropolitan and Micropolitan Statistical Areas.nThe
  Metropolitan Divisions boundaries are those defined by OMB based on the 2010 Census
  and published in 2013.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
